Create Proc [dbo].[InsertAuditLogPipeline] @workspacename nvarchar(20),@pipelinename nvarchar(20),@pipelineid nvarchar(20),@pipelinetriggertype nvarchar(20),@Pipelinestarttime datetime,@Pipelineendtime DATETIME,@Status nvarchar(20)
AS
BEGIN

Insert into [dbo].[audit_log_table](
    workspacename,
    pipelinename,
    pipelineid,
    pipelinetriggertype,
    pipelinestarttime,
    pipelineendtime,
    pipelinestatus
) values (
    @workspacename ,
    @pipelinename,
    @pipelineid,
    @pipelinetriggertype,
    @Pipelinestarttime ,
    @Pipelineendtime,
    @Status
)

END
